const Login = (props) => {
    return (
        <div>
            <h1>Login</h1>
            <form>
                <div>
                    <input placeholder="login" type={'text'} />
                </div>
                <div> <input placeholder="password" type={'password'} /></div>
                <div> <input placeholder="login" type={'checkbox'} /> </div>
                <div> button </div>
            </form>
        </div>
    )
}

export default Login;
